import React from 'react'
const DUMMY_EVENTS=[{
  id:1,title:'Product_1'
},
{id: 2,
  title:'Product2'
},
{id:3,
  title:'Product3'
}
];
export default function Events() {
  return (
    <>
      <h1>Events Page</h1>
      <ul>
        {DUMMY_EVENTS.map((item)=>{
          <li key={item.id}>
            <Link to={``}>{item.title}</Link>
            </li>
        })}
      </ul>
    </>
  )
}
